    // 贝叶斯优化搜索
    public List<RetrievalSystem> optimize() throws Exception {
        // 初始化随机子集
        List<RetrievalSystem> currentSubset = new ArrayList<>();
        Random rand = new Random(System.currentTimeMillis());
        int[] i=new int[5];

        while (currentSubset.size() < 5) {
            int k=0;
            int index = rand.nextInt(65) + 1;// 生成1到65之间的随机索引
            RetrievalSystem system = allSystems.get(index);
            if (!currentSubset.contains(system)) {
                currentSubset.add(system);
            }
        }

        // 定义全局变量用于存储最佳子集、对应的性能和多样性
        List<RetrievalSystem> bestSubset = new ArrayList<>();
        double bestPerformance = Double.MIN_VALUE;
        double bestDiversity = 0.0;
        // 迭代搜索
        for (int iter = 0; iter < 1000; iter++) {

            // 生成新的候选子集
            List<RetrievalSystem> candidateSubset = new ArrayList<>(currentSubset);
            if (!candidateSubset.isEmpty()) {
                int removeIndex = rand.nextInt(candidateSubset.size()); // 生成0到候选子集大小之间的随机索引
                candidateSubset.remove(removeIndex);
            }


            int addIndex = rand.nextInt(allSystems.size());
            RetrievalSystem systemToAdd = allSystems.get(addIndex);
            candidateSubset.add(systemToAdd);

           /* // 评估候选子集
            double candidatePerformance = evaluateSubset(candidateSubset);
            double candidateDiversity = calculateDiversity(candidateSubset);

            // 更新最佳子集
            if (candidatePerformance > bestPerformance ||
                    (candidatePerformance == bestPerformance && candidateDiversity > bestDiversity)) {
                currentSubset = candidateSubset;
                bestPerformance = candidatePerformance;
                bestDiversity = candidateDiversity;
            }*/


// 在更新子集后评估性能和多样性
// evaluatePerformance 方法用于评估子集的性能，可以根据具体情况实现
// calculateDiversity 方法用于计算子集的多样性，可以根据具体情况实现
            double newPerformance = evaluateSubset(candidateSubset);
            double newDiversity = calculateDiversity(candidateSubset);

// 计算性能下降的阈值
            double performanceThreshold = 0.005;

            double performanceChange = bestPerformance - newPerformance;
// 检查新子集的性能是否优于当前最佳性能
            if (newPerformance > bestPerformance || ((newPerformance == bestPerformance || performanceChange<0.005 ) && (newPerformance>bestDiversity))) {
                // 如果新子集性能更好，则更新最佳子集、最佳性能和最佳多样性
                bestSubset = new ArrayList<>(candidateSubset);
                bestPerformance = newPerformance;
                bestDiversity = newDiversity;
            } else {
                // 如果新子集性能较差，则回滚到之前的最佳子集
                candidateSubset = new ArrayList<>(bestSubset);
            }

// 计算性能变化


// 根据性能变化判断是否更换其他检索系统
            if (performanceChange > performanceThreshold) {
                // 尝试更换其他检索系统直至性能提升
                while (performanceChange > performanceThreshold) {
                   switchRetrievalSystem(candidateSubset);
                }
            } else {
                // 如果性能下降未超过阈值，则选择使集合多样性增加的检索系统
                // increaseDiversity 方法用于选择使集合多样性增加的检索系统，可以根据具体情况实现
                if ( newDiversity > bestDiversity) {
                    currentSubset = candidateSubset;
                    bestPerformance = newPerformance;
                    bestDiversity = newDiversity;
                }
            }


        }

        return currentSubset;
    }

    private void switchRetrievalSystem( List<RetrievalSystem> candidateSubset) {
        Random rand = new Random(System.currentTimeMillis());
        if (!candidateSubset.isEmpty()) {
            int removeIndex = rand.nextInt(candidateSubset.size()); // 生成0到候选子集大小之间的随机索引
            candidateSubset.remove(removeIndex);
        }
        int index = rand.nextInt(65) + 1;// 生成1到65之间的随机索引
        RetrievalSystem system = allSystems.get(index);
        if (!candidateSubset.contains(system)) {
            candidateSubset.add(system);
        }

    }

